import React from "react";
import "./Account.css";
import Header1 from "./Header1";
const Account = () => {
  return (
    <>
      {/* ===== Banner Section ===== */}
      <div className="banner-section">
        <div className="overlay">
          <nav className="breadcrumb">
            <a href="/Faq">WhatNew</a> / <span>Selling</span>
          </nav>
          <h1>Selling</h1>
         
        </div>
      </div>

    
 
    </>
  );
};

export default Account;
